import React, { Component } from 'react'

export default class Game extends Component {
    constructor(props){
        super(props);
        this.state={
            game:this.props.game
        };
    }
    render() {
        return (
            <div>
                <h4>{this.state.game.name}</h4>
            </div>
        )
    }
}
